import React from 'react';

function ImagePopup(props) {
    console.log(props.card)
    console.log(props.onClose)
    console.log(props.card.link)
    console.log(props.card.name)
    return (

        <article className={props.card ? "popup popup_type_zoomed popup_type_opened" : "popup popup_type_zoomed"} id="popup_type_zoomed">
        <div className="popup__zoomed">
            <button type="button" className="popup__button popup__button_type_close" aria-label="close" onClick={props.onClose}/>
            <img className="popup__picture" src={props.card.link} alt={props.card.name} />
            <p className="popup__caption">{props.card.name}</p>
        </div>
    </article>
    );

}

export default ImagePopup;
